/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_mtk_get_string_func
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
static get_multitap_string mmi_ime_multitap_mtk_get_string_func( mmi_imm_input_mode_enum input_mode )
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    
    S32 i = 0;

    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/

    if ( input_mode >= IMM_INPUT_MODE_MAX_NUM )
        return NULL;
    
    /* search from the first entry */
    while ( g_mtk_multitap_mode_info[i].input_mode != IMM_INPUT_MODE_MAX_NUM )
    {
        if ( g_mtk_multitap_mode_info[i].input_mode == input_mode )
        {
            return g_mtk_multitap_mode_info[i].get_string;
        }
        else
        {
            i++;
        }
    }

    return NULL;
}


