/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_is_symbol_key
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
MMI_BOOL mmi_ime_multitap_is_symbol_key( mmi_imm_input_mode_enum input_mode, mmi_imc_key_custom_value key_code )
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    S32 index = 0;
#if defined(__MMI_MULTITAP_FIRST_UPPERCASE__)
    const sIMEModeDetails * mode_details_ptr;
#endif
    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/
#if defined(__MMI_MULTITAP_FIRST_UPPERCASE__)
    
     mode_details_ptr = mmi_imm_get_input_mode_array_item(input_mode);

     if ((mode_details_ptr->Mode_Special_Attrib & IME_MODE_ATTR_TITLECASE)
               && (mode_details_ptr->Mode_Special_Attrib & IME_MODE_ATTR_MULTITAP))
     {
         mode_details_ptr = mmi_imm_get_corresponding_multitap_mode(input_mode, IME_MODE_ATTR_LOWERCASE);
         
         if (mode_details_ptr)
         {
             input_mode = mode_details_ptr->imm_mode_id;
         }
         else
         {
             return MMI_FALSE;
         }
     }   

#endif /* defined(__MMI_MULTITAP_FIRST_UPPERCASE__) */

    if (input_mode == g_multitap.input_mode)
    {
        return g_multitap.check_func_ptr((mmi_imc_symbol_key_enum)key_code);
    }
    else
    {
        if ( input_mode >= IMM_INPUT_MODE_MAX_NUM )
            return MMI_FALSE;
        
    #if defined(__MMI_ZI_MULTITAP__) || defined(__MMI_T9_MULTITAP__) || defined(__MMI_CSTAR_MULTITAP__)|| defined(__MMI_GUOBI_MULTITAP__)
        if (mmi_ime_word_is_symbol_key(input_mode, key_code) == MMI_TRUE)
        {
            return MMI_TRUE;
        }
    #endif
        
        /* search from the first entry */
        while ( g_mtk_multitap_mode_info[index].input_mode != IMM_INPUT_MODE_MAX_NUM )
        {
            if ( g_mtk_multitap_mode_info[index].input_mode == input_mode )
            {
                return g_mtk_multitap_mode_info[index].check_func_ptr((mmi_imc_symbol_key_enum)key_code);
            }
            else
            {
                index++;
            }
        }
        return MMI_FALSE;
    
    }
}


