/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_get_corresponding_key_code
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
U16 mmi_ime_multitap_get_corresponding_key_code(mmi_imm_input_mode_enum input_mode, UI_character_type char_code)
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    get_multitap_string get_string_func = NULL;
    UI_string_type string_ptr = NULL;
    S32 i;
    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/

    get_string_func = mmi_ime_multitap_mtk_get_string_func(input_mode);

#if defined(__MMI_ZI_MULTITAP__) || defined(__MMI_T9_MULTITAP__) || defined(__MMI_CSTAR_MULTITAP__)|| defined(__MMI_GUOBI_MULTITAP__)
    if (get_string_func == NULL)
    {
        get_string_func = (get_multitap_string)mmi_ime_multitap_vendor_get_string_func(input_mode);
    }
#endif


    if (get_string_func)
    {
        for(i = 0; i < MULTITAP_KEY_TOTAL; i++)
        {
            string_ptr = get_string_func(i);

            if (string_ptr)
            {
                if (!mmi_ucs2chr((const S8 *)string_ptr, char_code))
                {
                    if (i >= MMI_IMC_SYMB_KEY_0 && i<= MMI_IMC_SYMB_KEY_9) 
                    {
                        return i - MMI_IMC_SYMB_KEY_0 + KEY_0;
                    }
                    else if (i == MMI_IMC_SYMB_KEY_STAR)
                    {
                        return KEY_STAR;
                    }
                    else if (i == MMI_IMC_SYMB_KEY_POUND)
                    {
                        return KEY_POUND;
                    }
                    else
                    {
                        return KEY_INVALID;
                    }
                }
            }
        }
	}	

    return KEY_INVALID;
}


/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_get_alphabetic_keymap_table_size
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
U32 mmi_ime_multitap_get_alphabetic_keymap_table_size(void)
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    S32 str_len, max_len = 0, mode_num = 0;
    S32 i, j;
    UI_string_type string_ptr = NULL;
    get_multitap_string get_str_funcptr = NULL;
    
    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/

    for (i = 0; gIMEModeArray[i].imm_mode_id < IMM_INPUT_MODE_MAX_NUM; i++)
    {
        if (((gIMEModeArray[i].Lang_Special_Attrib & IME_LANG_ATTR_ALPHABETIC) 
              && (gIMEModeArray[i].Mode_Special_Attrib & IME_MODE_ATTR_UPPERCASE)) 
            || gIMEModeArray[i].imm_mode_id == IMM_INPUT_MODE_PHONE_NUMBER)
        {
            get_str_funcptr = mmi_ime_multitap_mtk_get_string_func(gIMEModeArray[i].imm_mode_id);

        #if defined(__MMI_ZI_MULTITAP__) || defined(__MMI_T9_MULTITAP__) || defined(__MMI_CSTAR_MULTITAP__)|| defined(__MMI_GUOBI_MULTITAP__)
            if (get_str_funcptr == NULL)
            {
                mmi_ime_word_change_mode(&gIMEModeArray[i],0 );	
			#if defined(__MMI_IME_MEMORY_CARD_SUPPORT__)
				mmi_imm_set_current_input_mode(gIMEModeArray[i].imm_mode_id);
			#endif
                get_str_funcptr = (get_multitap_string)mmi_ime_multitap_vendor_get_string_func(gIMEModeArray[i].imm_mode_id);
            }
        #endif
        
            if (get_str_funcptr == NULL)
            {
                continue;
            }
            
            mode_num++;
            
            for (j = 0; j < MULTITAP_KEY_TOTAL; j++)
            {
                if (get_str_funcptr)
                {
                    if (j == 1)
                    {
                        if (max_len < 1)
                        {
                            max_len = 1;
                        }
                    }
                    else if (j == 0)
                    {
                        if (max_len < 2)
                        {
                            max_len = 2;
                        }
                    }

else if (j ==10)
{
    if (max_len < 1)
    max_len = 1;
}
else if (j == 11)
{
    if (max_len < 1)
    max_len = 1;
}

  
                    else 
                    {
                        string_ptr = get_str_funcptr(j);
                        
                        if (string_ptr)
                        {
                            str_len = mmi_ucs2strlen((const S8 *)string_ptr);

                            if (str_len > max_len)
                            {
                                max_len = str_len;
                            }
                        }
                    }
                }
            }
        }
    }

    return (U32)((max_len * mode_num + 1) * MULTITAP_KEY_TOTAL * sizeof(UI_character_type));
}


/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_create_alphabetic_keymap_table
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
MMI_BOOL mmi_ime_multitap_create_alphabetic_keymap_table(U16 * buffer_ptr, U32 buffer_size)
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    U32 key_str_size = buffer_size / MULTITAP_KEY_TOTAL / sizeof(UI_character_type);
    S32 i, j, k, str_len, key_str_len;
    UI_string_type string_ptr = NULL;
    MMI_BOOL ret_val = MMI_FALSE;
    get_multitap_string get_str_funcptr = NULL;
    
    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/
 
    memset(buffer_ptr, 0, buffer_size);

    for (i = 0; gIMEModeArray[i].imm_mode_id < IMM_INPUT_MODE_MAX_NUM; i++)
    {
        if (((gIMEModeArray[i].Lang_Special_Attrib & IME_LANG_ATTR_ALPHABETIC) 
              && (gIMEModeArray[i].Mode_Special_Attrib & IME_MODE_ATTR_UPPERCASE)) 
            || gIMEModeArray[i].imm_mode_id == IMM_INPUT_MODE_PHONE_NUMBER)
        {
            for (j = 0; j < MULTITAP_KEY_TOTAL; j++)
            {
                if (j == 0)
                {
                    buffer_ptr[0] = '0';
                    buffer_ptr[1] = '+';
                }
                else if (j == 1)
                {
                    buffer_ptr[key_str_size] = '1';
                }
             else if (j == 10)
            {
                    buffer_ptr[key_str_size*j] = '*';
            }
            else if (j == 11)
            {
                    buffer_ptr[key_str_size*j] = '#';
            }

  
                else 
                {
                    get_str_funcptr = mmi_ime_multitap_mtk_get_string_func(gIMEModeArray[i].imm_mode_id);

                #if defined(__MMI_ZI_MULTITAP__) || defined(__MMI_T9_MULTITAP__) || defined(__MMI_CSTAR_MULTITAP__)|| defined(__MMI_GUOBI_MULTITAP__)
                    if (get_str_funcptr == NULL)
                    {
                        get_str_funcptr = (get_multitap_string)mmi_ime_multitap_vendor_get_string_func(gIMEModeArray[i].imm_mode_id);
                    }
                #endif
                
                    if (get_str_funcptr)
                    {
                        string_ptr = get_str_funcptr(j);
                        
                        if (string_ptr)
                        {
                            str_len = mmi_ucs2strlen((const S8 *)string_ptr);
                            
                            for (k = 0; k < str_len; k++)
                            {
                                if(!mmi_ucs2chr((const S8 *)&buffer_ptr[key_str_size * j], string_ptr[k]))
                                {
                                    key_str_len = mmi_ucs2strlen((const S8 *)&buffer_ptr[key_str_size * j]);
                                    
                                    buffer_ptr[key_str_size * j + key_str_len] = string_ptr[k];

                                    ret_val = MMI_TRUE;
                                }
                            }
                        }
                    }
                }
            }
        }
    }

    return ret_val;
}


/*****************************************************************************
 * FUNCTION
 *  mmi_ime_multitap_get_keymap
 * DESCRIPTION
 * PARAMETERS
 * RETURNS
 *****************************************************************************/
U16 * mmi_ime_multitap_get_keymap(U16 * keymap_table, U16 key_code, U32 buffer_size)
{
    /*----------------------------------------------------------------*/
    /* Local Variables                                                */
    /*----------------------------------------------------------------*/
    U32 key_str_size = buffer_size / MULTITAP_KEY_TOTAL / sizeof(UI_character_type);
    S32 index;
    
    /*----------------------------------------------------------------*/
    /* Code Body                                                      */
    /*----------------------------------------------------------------*/

    if (key_code <= KEY_9)
    {
        index = key_code - KEY_0;
    }
    else if (key_code == KEY_STAR)
    {
        index = MMI_IMC_SYMB_KEY_STAR - MMI_IMC_SYMB_KEY_BASE;
    }
    else if (key_code == KEY_POUND)
    {
        index = MMI_IMC_SYMB_KEY_POUND - MMI_IMC_SYMB_KEY_BASE;
    }
    else
    {
        return NULL;
    }

    if (keymap_table && key_str_size > 0)
    {
        return &keymap_table[key_str_size * index];
    }
    else
    {
        return NULL;
    }
}
